लॉक डाउन के चलते ताज महल पिछले 2 महीने से बंद है। कल रात तेज आंधी तूफान ने ताज महल परिसर को काफी नुकसान पोहचाया है। परिसर में जहाँ रेलिंग लगी थी वो टूट गयी,टिकट केंद्र और बगीचे  में भी काफी नुकसान हुआ है। For more updates follow - @the_unorthodox_indian 
